Based on the true story of Elisabeth Bathory, the eighteenth-century
Transylvanian Countess who indulged herself in an orgy of murder and
vampirism before before being walled up in her room by the authorities.
The ageing Countess Dracula discovers by accident that the blood of young
virgins has an unnatural restorative effect on her celebrated beauty.
Years later, she becomes engaged to a handsome young Hussar and is forced
to repeat vile atrocities with ever-increasing regularity to hold off old age.

